import React from 'react';

class Product extends React.Component{
    state = {
        loading: true
    };

    async componentDidMount() {
        const url = "https://api.randomuser.me/";
        const response = await fetch(url);
        const data = await response.json();
        console.log('data');
    }
}

export default Product;
